  BANK_2_KONTONUM VARCHAR(16) CHARACTER SET NONE COLLATE NONE,
  BANK_2_IBAN VARCHAR(34) CHARACTER SET NONE COLLATE NONE,
  BANK_3_ID INTEGER,
